SET QUOTED_IDENTIFIER ON
GO
CREATE VIEW [dbo].[v_ProductQuatitySold]
AS

SELECT (SELECT title from Product where id = p.id) AS Product, p.id, SUM(quantity) AS Quantity FROM Product p JOIN OrderLine ol 
ON p.id = ol.product_id group by p.id
