/****** Object:  StoredProcedure [dbo].[sp_createInvoice]    Script Date: 2019-04-07 11:05:10 AM ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO
CREATE PROC [dbo].[sp_createInvoice] (@order_id int)
 AS
SELECT ol.[id],ol.[product_id],
title AS product_name,
(p.price + COALESCE( v_olcp.price, 0)) * quantity AS total_price, 
[quantity],[gift_wrap],[order_id],[details]
  FROM [dbo].[OrderLine] ol JOIN Product p 
  ON p.id = ol.product_id LEFT JOIN v_OrderLineCustomizationPrice v_olcp
ON ol.id = v_olcp.orderline_id
WHERE [order_id] = @order_id
GO
/****** Object:  StoredProcedure [dbo].[sp_getAverageRatingForAProduct]    Script Date: 2019-04-07 11:05:10 AM ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO
CREATE PROC [dbo].[sp_getAverageRatingForAProduct] (@prodId int)
AS
SELECT p.title, AVG(rating) as average_rating FROM Feedback f JOIN OrderLine ol 
ON f.order_line_id = ol.id
JOIN Product p ON p.id = ol.product_id
where p.id = @prodId
GROUP BY p.title

GO
