/****** Object:  StoredProcedure [dbo].[sp_getMoneyMadeInDateRange]    Script Date: 2019-04-07 11:05:10 AM ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO
CREATE PROC [dbo].[sp_getMoneyMadeInDateRange](@start datetime, @end datetime)
AS

SELECT @start As start_date, @end As end_date,
SUM((p.price + COALESCE( v_olcp.price, 0)) * quantity) AS money_made
  FROM [dbo].[OrderLine] ol JOIN Product p 
  ON p.id = ol.product_id LEFT JOIN v_OrderLineCustomizationPrice v_olcp
ON ol.id = v_olcp.orderline_id WHERE ol.order_id IN (SELECT id FROM [Order] WHERE order_date BETWEEN @start AND @end)
GO
